import React from 'react';
import { ActionIcon, useMantineColorScheme } from '@mantine/core';
import { IconSun, IconMoonStars } from '@tabler/icons';
import { createStyles, Header, Container, Text, Button, Title, useMantineTheme, Menu, Box, NavLink  } from '@mantine/core';
import { Link } from "react-router-dom";
import {
    IconSquareCheck,
    IconPackage,
    IconUsers,
    IconCalendar,
    IconChevronDown,
  } from '@tabler/icons';
// import { HomeSignal } from 'tabler-icons-react';


const useStyles = createStyles((theme) => ({
header: {
    backgroundColor: theme.fn.variant({ variant: 'filled', color: theme.primaryColor }).background,
    borderBottom: 0,
},

inner: {
    height: 0,
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
},

}));



export default function HeaderMenuColored({loggedInUser}) {
    const { classes } = useStyles();

    // const profileUrl = `/${loggedInUser.username}`;

    return (
        <>
        <Header height={80} className={classes.header}>
        <Box sx={{ width: 240 }}>
      <NavLink
        label="First parent link"
        childrenOffset={28}
      >
        <NavLink label="First child link" />
        <NavLink label="Second child link" />
        <NavLink label="Nested parent link" childrenOffset={28}>
          <NavLink label="First child link" />
          <NavLink label="Second child link" />
          <NavLink label="Third child link" />
        </NavLink>
      </NavLink>

      <NavLink
        label="Second parent link"
        childrenOffset={28}
        defaultOpened
      >
        <NavLink label="First child link" />
        <NavLink label="Second child link" />
        <NavLink label="Third child link" />
      </NavLink>
    </Box>
        </Header>
        </>
    );
}
